import React, { useEffect } from "react";
import { DateRangePicker } from "rsuite";

export default function IndexPage() {
  useEffect(() => {
    document.title = "Информация";
  }, []);

  return (
    <div>
      <DateRangePicker
        appearance="default"
        placeholder="Default"
        style={{ width: 230 }}
      />
      <h1>Типа страница с информацией</h1>
    </div>
  );
}
